$.renderTree = function () {
    $(".tree > ul").attr("role", "tree").find("ul").attr("role", "group"), $(".tree").find("li:has(ul)").addClass("parent_li").attr("role", "treeitem").find(" > span > i").attr("title", "Collapse this branch").on("click", function (a) {
        var b = $(this).parent().parent("li.parent_li").find(" > ul");
        console.info(b);
        b.is(":visible") ? (b.hide("fast"), $(this).attr("title", "Expand this branch").addClass("glyphicon-plus").removeClass("glyphicon-minus")) : (b.show("fast"), $(this).attr("title", "Collapse this branch").addClass("glyphicon-minus").removeClass("glyphicon-plus"));
    })
}